e textarea, a numeric spinner, and a compound date control.',CUf='<b>Click<\/b> on any cell to start editing. Use Tab/Arrow keys to move between cells, Enter/Esc keys to save or cancel. Editing is disabled for the "Country" and "G8" columns.',pWf='<b>Communism<\/b> - a system of government in which the state plans and controls the economy and a single - often authoritarian - party holds power; state controls are imposed with the elimination of private ownership of property or capital while claiming to make progress toward a higher social order in which all goods are equally shared by the people (i.e., a classless society).',qWf='<b>Constitutional monarchy<\/b> - a system of government in which a monarch is guided by a constitution whereby his/her rights, duties, and responsibilities are spelled out in written law or by custom.',nJf='<b>Destination<\/b> (drag to move or resize)',JUf='<b>Double-click<\/b> on any cell to start editing. Click anywhere outside of the cell editors to save changes, or press the <b>Esc<\/b> key to discard changes.',sWf='<b>Federal (Federative)<\/b> - a form of government in which sovereign power is formally divided - usually by means of a constitution - between a central authority and a number of constituent regions (states, colonies, or provinces) so that each region retains some management of its internal affairs; differs from a confederacy in that the central government exerts influence directly upon both individuals as well as upon the regional units.',rWf='<b>Federal republic<\/b> - a state in which the powers of the central government are restricted and in which the component parts (states, colonies, or provinces) retain a degree of self-government; ultimate sovereign power rests with the voters who chose their governmental representatives.',lpf='<b>Japan<\/b>',hPf='<b>Message from Rob:<\/b><BR>',mnf='<b>Mouse Me<\/b>',IXf='<b>No alignment<\/b>',IWf='<b>Number of server trips : 0<\/b>',EWf='<b>Number of server trips: ',tWf='<b>Parliamentary monarchy<\/b> - a state headed by a monarch who is not actively involved in policy formation or implementation (i.e., the exercise of sovereign powers by a monarch in a ceremonial capacity); true governmental leadership is carried out by a cabinet and its head - a prime minister, premier, or chancellor - who are drawn from a legislature (parliament).',uWf="<b>Republic<\/b> - a representative democracy in which the people's elected deputies (representatives), not the people themselves, vote on legislation.",rJf='<b>Reset<\/b>',_if='<b>Samples<\/b>',L3f="<b>Severity 1<\/b> - Critical problem<br/>System is unavailable in production or is corrupting data, and the error severely impacts the user's operations.<br/><br/><b>Severity 2<\/b> - Major problem<br/>An important function of the system is not available in production, and the user's operations are restricted.<br/><br/><b>Severity 3<\/b> - Minor problem<br/>Inability to use a function of the system occurs, but it does not seriously affect the user's operations.",jnf="<b>Severity 1<\/b> - Critical problem<br>System is unavailable in production or is corrupting data, and the error severely impacts the user's operations.<br><br><b>Severity 2<\/b> - Major problem<br>An important function of the system is not available in production, and the user's operations are restricted.<br><br><b>Severity 3<\/b> - Minor problem<br>Inability to use a function of the system occurs, but it does not seriously affect the user's operations.",POf="<b>Severity 1<\/b><p>Critical problem.  System is unavailable in production or is corrupting data, and the error severely impacts the user's operations.",QOf="<b>Severity 2<\/b><p> Major problem.  An important function of the system is not available in production, and the user's operations are restricted.",SOf="<b>Severity 3<\/b><p> Minor problem.  Inability to use a function of the system occurs, but it does not seriously affect the user's operations.",hpf='<b>United States<\/b>',sof='<br/>',GWf='<br/>Last range of records returned: ',FWf='<br/>Total rows in this filter set: ',pJf='<br>',NOf="<br><b>Severity 1<\/b> - Critical problem<br>System is unavailable in production or is corrupting data, and the error severely impacts the user's operations.<br><br><b>Severity 2<\/b> - Major problem<br>An important function of the system is not available in production, and the user's operations are restricted.<br><br><b>Severity 3<\/b> - Minor problem<br>Inability to use a function of the system occurs, but it does not seriously affect the user's operations.",QKf='<br><br>Drag &amp; drop parts here',jKf='<br><br>Nothing selected',IRf='<br>Click the <b>Set data<\/b> button to populate this grid.',_2f='<br>Drag &amp; drop parts here',mlf="<hr><span class='exampleDropTitle'>Ajax&nbsp;&nbsp;<\/span> <b>A<\/b>synchronous <b>J<\/b>avaScript <b>A<\/b>nd <b>X<\/b>ML (AJAX) is a Web development technique for creating interactive <b>web applications<\/b>.<hr>",qlf="<hr><span class='exampleDropTitle'>RIA&nbsp;&nbsp;<\/span> <b>R<\/b>ich <b>I<\/b>nternet <b>A<\/b>pplications (or RIA) are <b>web applications<\/b> that have the features and functionality of traditional <b>desktop applications<\/b>.<hr>",rlf="<hr><span class='exampleDropTitle'>Web App&nbsp;&nbsp;<\/span> In software engineering, a <b>web application<\/b> is an application that is <b>accessed with a web browser<\/b> over a network such as the Internet or an intranet.<hr>",Klf='<i>Approved<\/i> for release',u4e='<nobr>',CNf='<nobr>&gt;?&lt;??????????????<nobr>',FNf='<nobr>&gt;LL<\/nobr>',JNf='<nobr>(###)&nbsp;###-####<\/nobr>',fpf='<nobr>A SelectItem with icons<\/nobr>',Ipf='<nobr>A SelectItem with styled entries<\/nobr>',XNf='<nobr>A combobox with icons<\/nobr>',YNf='<nobr>A combobox with styled entries<\/nobr>',LNf='<nobr>A plain text field<\/nobr>',Zof='<nobr>A simple ComboBoxItem<\/nobr>',WNf='<nobr>A simple combobox<\/nobr>',_Nf='<nobr>Direct date input<\/nobr>',lnf='<nobr>Last event: (mouse over the canvas below...)<\/nobr>',snf='<nobr>Last event: <b>',Sqf='<nobr>Multi Select with icons<\/nobr>',$Nf='<nobr>Picklist based date input<\/nobr>',Mif="<p class='intro-para'>",nUf='<p><b>Click<\/b> on any cell of the &quot;Value Field&quot; column to start editing. This example illustrates have cell editors can be customized for the <b>same<\/b> ListGridField, but different records using ListGrid.setEditorCustomizer(..)<\/p>',GUf='<p><b>Click<\/b> on any cell to start editing, then <b>Tab<\/b> or <b>Down Arrow<\/b> past the last row in the grid to create a new row.<\/p><p>Alternatively, click the <b>Edit New<\/b> button to create a new data-entry row at the end of the grid.<\/p>',FUf='<p><b>Click<\/b> on any cell to start editing. Use <b>Tab<\/b>, <b>Shift-Tab<\/b>, <b>Up Arrow<\/b>, and <b>Down Arrow<\/b> to move between cells.<\/p><p>Changes are saved automatically when you move to another row. Press <b>Enter<\/b> to save the current row and dismiss the editors, or <b>Esc<\/b> to discard changes for the current row and dismiss the editors.<\/p>',EUf='<p><b>Click<\/b> on any cell to start editing. Use <b>Tab<\/b>, <b>Shift-Tab<\/b>,<b>Up Arrow<\/b>, and <b>Down Arrow<\/b> to move between cells.<\/p><p>Press <b>Enter<\/b> to save the current rowand dismiss the editors, or <b>Esc<\/b> to discard changes for the current cell and dismissthe editors.<\/p>',PRf='<p><b>Formula and Summary fields<\/b> provide built-in wizards for end users to define formula fields that can compute values using other fields, or summary fields that can combine other fields with intervening / surrounding text. Available in all DataBoundComponents, easy to persist aspreferences.<\/p><p>The Formula and Summary Builder are accessible from the grid header context menu. They can also be invoked programatically as demonstracted by clicking the buttons in this sample<\/p><p>Launch the Formula Builder and enter the title of the new field, and the desired formula. For example, enter <b>Population Density<\/b> for the field name and in the formula field enter <b>A / B<\/b>. As indicated in the dialog, A represents the Population field, and B represents the Area field. Notice that you can now sort on this newly added <b>Population Density<\/b> field just like any other field. Click the help icon to view the various supported inbuilt functions.<\/p><p>Next launch the Summary Builder and enter the title of the new field, and the Summary formulation. For example, enter <b>County (Flag)<\/b> for the field name and enter <b>#B (#A)<\/b> in the summary field.<\/p>',NLf='<p>A special type of form control called a CanvasItem allows any kind of SmartClient widget to participate in form layout and values management.<\/p><p>Drag resize the form &mdash; notice how the embedded ListGrid fills the available space.<\/p><p>The embedded ListGrid starts out showing the initial value provided to the form ("Germany"). Click the button titled "Set Value: France" to provide a new value to the form, causing the CanvasItem to display this value.<\/p><p>Click on any country in the list &mdash; the form picks up the value and fires standard change events, causing new values to be displayed in a Label.<\/p><p>This CanvasItem provides functionality similar to an HTML &lt;select&gt;, however, because it\'s based on a ListGrid, any ListGrid behavior could be added: data paging, drag and drop, hovers, inline search, inline editing, grouping, etc.<\/p>',O2f='<p>Begin opening folders and note the prompt which briefly appears during server fetches.<\/p><p>DataBound Trees support load on demand. When a folder is opened for the first time, the tree asks the server for the children of the node just opened.<\/p>',dXf='<p>Begin typing a country name into in the filter box for the Country column. Grids can be configured to filter as you type..<\/p>',PSf='<p>By default, grids used in a Layout will fill available space, allowing users to show and hide other components on the screen in order to view and interact with more data at once in the grid.<\/p><p>Imagine that the blue outline represents all the space that is available for this interface. Click on the "Details" header to hide the tabs and reveal more rows.<\/p><p>Click on the resizebar next to the Navigation tree to hide it, allowing more space for columns.<\/p>',DSf='<p>Change the filter to show the grid resizing within the constraint of its maximum autofit rows.<\/p><p>Enter a country filter of "cook island" to see the grid shrink down to minimum size. <\/p><p>Change the country filter to "island" to show the grid at almost maximum size, but not scrolling.<\/p><p>Change the country filter to "land" to show the grid scrolling because its maximum autofit size (10) isn\'t large enough to display all rows.<\/p>',iVf='<p>Click "Load Schema" to load a supplyItem DataSource from XML Schema (XSD) format, then extend that schema with Smart GWT-specific presentation attributes, and bind the Grid and Form to it.<\/p><p>Note that the internal "itemId" field has been hidden from the user, some fields have been retitled, and default editors overriden.<\/p>',VGf='<p>Click "Save" to see validation errors derived from an JSON response. Validation errors expressed in application-specific JSON formats can be communicated to visual components by implementing DataSource.setResponseTransformHandler().<\/p> <p>The resulting validation errors will be displayed and tracked by forms and editabled grids.<\/p>',JHf='<p>Click "Save" to see validation errors derived from an XML response. Validation errors expressed in application-specific XML formats can be communicated to visual components by implementing DataSource.setResponseTransformHandler(). The resulting validation errors will be displayed and tracked by forms and editabled grids.<\/p>',tLf='<p>Click "Validate" to see validation errors triggered by rules both in this form and in the DataSource.<\/p><p>Screen-specific fields and validation logic, such as the duplicate password entry box, can be added to a particular form while still sharing schema information that applies to all views.<\/p>',Enf='<p>Click and hold on the "Save" button to see the icon change as the button goes down. Note that the binoculars icon does not change when the button goes down.<\/p> <p>Click "Disable Save" to see the icon change to reflect disabled state. Button icons can be left or right oriented, and can optionally react to any state of the button.<\/p>',Iqf='<p>Click on "Department" or "Category" below to show hierarchical menus.<\/p><p>The "Category" menu loads options dynamically from the SupplyCategory DataSource. Notice how the Tree data is fetched on demand when first accessed.<\/p>',$3f='<p>Click on "Show Window" to show a modal window.<\/p><p>Note that the "Touch This" button no longer shows rollovers or an interactive cursor, nothing outside the window can be clicked, clicks outside the window cause the window to flash, and tabbing remains in a closed loop cycling through only the contents of the window.<\/p>',HUf='<p>Click on any cell to start editing, then <b>Tab<\/b> or <b>Down Arrow<\/b> past the last row in the grid to create a new row.<\/p><p>Alternatively, click the Edit New button to create a new data-entry row at the end of the grid. Unlike the other editing examples, none of your changes are being automatically saved to the server. Note how Smart GWT highlights changed values, and new rows.<\/p><p>Click the "Save" button to save all your changes at once, or click the "Discard" button to discard all your changes (including any new rows) and revert to the data as it was before you started editing.<\/p>',O$f='<p>Click on any section header showing an arrow to expand and collapse it (the "Green Cube" section is marked not collapsible).<\/p><p>Click on the "Expand Blue" and "Collapse Blue" buttons to expand and collapse the blue section externally.<\/p>',sqf='<p>Click on the SelectItem on the left to see the full set of data. You can enter filter criteria directly on the drop-down list in either field to filter the set of options down to a managable size.<\/p>',bVf='<p>Click the "Remove" button to remove the selected item.<\/p>',XKf='<p>Click the radio buttons to apply different CSS styles to the text. Click the CSS tab for CSS class definitions.<\/p><p>This container auto-sizes to the styled text.<\/p>',iWf='<p>Click to select a single row in the grid. Shift-click to select a continuous range of rows.<\/p><p>Ctrl-click to add or remove individual rows from the selection.<\/p>',O_f='<p>Custom controls may appear on Tab Bars.<\/p>',d_f='<p>Custom controls may appear on section headers.<\/p>',OVf='<p>DataBoundComponents allow end-users to create \'hilites\' with rules based on the values of data. There are two sorts of hilites: simple hilites, which allow a single criterion based on a single field to affect a single target field (the same one), and Advanced hilites, which allow very complex criteria, based on multiple fields, to affect multiple target fields.<\/p><p>Click the "Edit Hilites" button below to show the HiliteEditor interface. To set up a simple hilite, click on the "Area (km<sup>2<\/sup>)" record in the list to the left. When the simple hilite rule appears on the right, select the "greater than" operation from the drop-down box, type "5000000" into the value textBox, select a color from the \'Color\' picker widget and click \'Save\'. You\'ll see that all "Area (km<sup>2<\/sup>)" values in the grid that exceed 5000000 are now hilighted in your chosen color.<\/p><p>Now, add an Advanced criteria. Again, click the "Edit Hilites" button and then click the "Add Advanced Rule" button in the top left of the HiliteEditor - you\'ll now see the AdvancedHiliteEditor window. Add a new criterion that specifies <i>GDP ($M) greater than 1000000<\/i>. Click the green plus icon beneath the criterion and add a second one, this time specifying <i>Area (km<sup>2<\/sup>) less than 500000<\/i>. In the list below, select both "GDP ($M)" and "Area (km<sup>2<\/sup>)" and select a background color. Clicking \'Save\' now will update the grid, showing both GDP and Area data in your selected background color, when GDP is higher than 1 million and Area is less than <i>500,000<\/i>.<\/p><p>You can easily provide users with the ability to save and restore their hilite information - all you need is the ability to save a string. Click the button below to see the grid\'s hilite state retrieved and serialized, by calling <i>getHiliteState()<\/i>, the grid destroyed and it\'s hilite-state restored to another grid via <\/i>setHiliteState()<\/i>.<\/p> ',mHf='<p>DataSources can bind directly to JSON data where records appear as an Array of JavaScript Objects with field values as properties.<\/p><p>This approach of loading simple JSON data over HTTP can be used with PHP and other server technologies.<\/p>',nIf='<p>DataSources can extract field values from complex XML documents via XPath expressions. Note how the address fields, which are represented in the contacts data as a subelement, appear as columns in the grid.<\/p><p>This approach of loading simple XML data over HTTP can be used with PHP and other server technologies.<\/p>',VYf='<p>Demonstrates a range of Smart GWT GUI components, data binding operations, and layout managers in a single-page application.<\/p>',cKf='<p>Drag and drop to copy items from the first list to the second list. You can drag over the top or bottom edge of a scrolling list to scroll in that direction before dropping.<\/p><p>You can also use the various transfer icons to move / reorder records. The icons shown below are part of the standard library and is accessible using the constants in the class TransferImgButton.<\/p>',R2f='<p>Drag and drop to move parts and folders within and between the trees. You can open a closed folder by pausing over it during a drag interaction (aka "spring loaded folders").<\/p>',ZPf='<p>Drag employee records into the Project Team Members list. Smart GWT recognizes that the two dataSources are linked by a foreign key relationship, and automatically uses that relationship to populate values in the record that is added when you drop. Smart GWT also populates fields based on current criteria and maps explicit titleFields as necessary.<\/p><p>In this example, note that Smart GWT is automatically populating all three of the fields in the teamMembers dataSource, even though none of those fields is present in the employees dataSource we are dragging from. Change the "Team for Project" select box, then try dragging employees across; note that the Project Code column is being correctly populated for the dropped records.<\/p>',cWf='<p>Drag to select a range of rows. Alternatively a single row in the grid and then Shift-click to select a continuous range of rows.<\/p><p>Ctrl-click to add or remove individual rows from the selection.<\/p>',$Wf="<p>DynamicForms and FormItems are capable of parsing simple expressions entered as part of their values, when allowExpressions is true on either entity. ListGrids use this facility, when showFilterEditor and allowFilterExpressions are true, to allow expressions to be entered directly into the FormItems displayed in the filterEditor.<\/p><p>Below is a ListGrid with a FilterEditor and allowFilterExpressions: true. Some expression-based filter-criteria have been applied via initialCriteria: the list displays countries with no 'i's in the country name, with a Capital that starts with a letter &quot;A&quot; through &quot;F&quot; and with a population less than 1 million or more than 100 million.<\/p><p>See the table on the right for the supported expression-symbols. Note that logical &quot;and&quot; and &quot;or&quot; expressions are treated as text in text-based fields and ignored.<\/p>",B2f="<p>First choose an employee via the menu to see that employee's direct reports in the ListGrid.<\/p><p>Click on employees in the tree to edit them, and drag and drop employees to rearrange them. <p>Changing an employee's salary in the grid will be automatically reflected in the tree.<\/p><p>Dragging an employee to another manager in the tree will make that employee appear or disappear in the grid if the grid is showing the original or new manager's employees.<\/p><p>Changes made in the tree or ListGrid are automatically saved to the server and reflected in the other components.<\/p>",Ikf='<p>HLayout and VLayout containers manage the stacked positions and sizes of multiple member components.<\/p><p>Resize the browser window to reflow these layouts.<p>',TRf='<p>HeaderSpans are a second level of headers that appears above the normal ListGrid headers, providing a visual cue for grouping.<\/p><p>Resize columns and note that the HeaderSpans change accordingly. Right-click in the header and note that you can hide and display spanned columns as a group, as well as individually.<\/p>',KVf='<p>Hiliting can be applied to any field in a DataBoundComponent, including custom formula and summary fields.<\/p><p>Launch the Formula Builder and enter the title of the new field, and the desired formula. In this case, enter Population Density for the field title and in the formula field enter <b>A / B<\/b>. As indicated in the dialog, <b>A<\/b> represents the Population field, and <b>B<\/b> represents the Area field. Notice that you can now sort on this newly added Population Density field just like any other field. Click the help icon to view the various supported inbuilt functions.<\/p><p>Now, click the "Edit Hilites" button to show the HiliteEditor interface. To set up a simple hilite on the custom <b>Population Density<\/b> field, select it in the list to the left. When the simple hilite rule appears on the right, select the "greater than" operation from the drop-down box, type "300" into the value textBox, select a color from the \'Color\' picker widget and click \'Save\'. You\'ll see that all the grid-values in the <b>Population Density<\/b> field that exceed 300 are now hilighted in your chosen color. <\/p> ',gQf='<p>In the first example, <b>Double Click<\/b> on any row to start editing. Select a value in the "Division" column to change the set of options available in the "Department" column.<\/p><p>In the second example, click the <b>Order New Item<\/b> button to add an editable row to the grid. Select a Category in the second column to change the set of options available in the "Item" column.<\/p>',QVf='<p>In this grid of Customer Orders, you can hover over a row to see a list of messages attached to the order.  This gives you a quick preview of discussion about the order, without the need to leave the list of orders.<\/p><p>In a complete application, clicking the order would lead to a detail screen showing the full order details and the ability to add to the discussion.<\/p>',NUf='<p>In this grid of Supply Categories, you can expand a row by clicking the special expansionField to see a sub-grid containing the list of Supply Items applicable to the selected Category. <\/p>',iof='<p>In this sample the display formats for Calendar hours and dates have been customized to be 24 hour based and to have a european date format of DD/MM/YYYY.<\/p>',wVf='<p>Inline editing works normally with grouped data. Try editing the field that records are grouped by and notice that the record moves to its new group automatically.<\/p>',HQf='<p>ListGrids support displaying summaries of the current data set in various ways:<\/p><p>Fields from individual records can be summarized into a single field value. In this example the "Total" field displays a summary value calculated by multiplying the "Quantity" and "Price" fields.<\/p><p>Summaries can also be displayed for multiple records. This example shows a summary row at the end of each group in the grid as well as an overall summary row with information about every record in the grid. Note that in addition to standard summary functions such as "sum" to generate a total, or "count" to generate a count of records, completely custom functions may be used. This is demonstrated in the "Category" field where a custom function determines how many categories exist in this dataset.<\/p>',GQf='<p>ListGrids support displaying summaries of the current data set in various ways:<\/p><p>Fields from individual records can be summarized into a single field value. In this example the "Total" field displays a summary value calculated by multiplying the "Quantity" and "Price" fields.<\/p><p>Summaries can also be displayed for multiple records. This example shows a summary row at the end of each group in the grid as well as an overall summary row with information about every record in the grid. Note that in addition to standard summary functions such as "sum" to generate a total, or "count" to generate a count of records, completely custom functions may be used. This is demonstrated in the "Category" field where a custom function determines how many categories exist in this dataset.<\/p><p>As illustrated in this sample, by calling listGrid.setShowGroupSummaryInHeader(true) field summary values for each group are displayed directly in the group header node, rather than showing up at the bottom of each expanded group<\/p>',xQf='<p>ListGrids support displaying summaries of the current data set in various ways:<\/p><p>Fields from individual records can be summarized into a single field value. In this example the "Total" field displays a summary value calculated by multiplying the "Quantity" and "Price" fields.<\/p><p>Summaries can also be displayed for multiple records. This example shows a summary row at the end of each group in the grid as well as an overall summary row with information about every record in the grid. Note that in addition to standard summary functions such as "sum" to generate a total, or "count" to generate a count of records, completely custom functions may be used. This is demonstrated in the "Category" field where a custom function determines how many categories exist in this dataset.<\/p><p>By calling ListGrid.addSummaryFunction multiple times you can apply more than one summary function to a field. This allows the developer to set up multi-line summaries - each specified summary function result will show up in a separate summary row<\/p>',knf='<p>Mouse over the blue square to see the color respond to your position. Click and hold to see a fade. If you have a mousewheel, roll up and down to change size.<p><p>Smart GWT components support the standard mouse events in addition to custom events like "mouseStillDown".<\/p>',arf='<p>Open the picker in either form to select the item you want to order from the "supplyItem" DataSource.<\/p><p>The picker on the left stores the "itemId" from the related "supplyItem" records. The picker on the right stores the "SKU" while displaying multiple fields. You can scroll to dynamically load more records. This pattern works with any DataSource.<\/p>',x_f='<p>Press the "Show Section" and "Hide Section" buttons to reveal or hide the Yellow Section.<\/p><p>Showing and hiding sections lets you reuse a SectionStack for slightly different purposes, hiding or revealing relevant sections.<\/p>',SUf='<p>Right click on any column header to show a menu that allows you to freeze that column.Multiple columns may be frozen, and frozen columns may be reordered.<\/p><p>Right click on a frozen column to unfreeze it.<\/p>',IQf='<p>Rows are fetched automatically as the user drags the scrollbar. Drag the scrollbar quickly to the bottom to fetch a range near the end (a prompt will appear during server fetch).<\/p><p>Scroll slowly back up to fill in the middle.<\/p><p>Another key unique feature of Smart GWT is lazy rendering of <b>columns<\/b>. Most browsers cannot handle displaying a large number of column and have serious performance issues.Smart GWT however does not render all columns outside the visible area by default and only renders them as you scroll horizontally. You can however disable this feature if desired.<\/p><p>You can control how far ahead of the currently visible area rows should be rendered. This is expressed as a ratio from viewport size to rendered area size. The default is 1.3.<\/p><p>Tweaking drawAheadRatio allows you to make tradeoffs between continuous scrolling speed vs initial render time and render time when scrolling by large amounts.<\/p>',Tqf='<p>Select "Other.." from the drop down to enter a custom value.<\/p>',aVf='<p>Select an item and use the form to change its price. The list updates automatically.<\/p>',y2f='<p>Setting frozen:true enables frozen columns for Trees.<\/p><p>Columns can be frozen and unfrozen by right-clicking on column headers.Column resize, column reorder, drag and drop and load on demand all function normally. Double click a cell to edit.<\/p>',ELf='<p>Setting the focus / cursor on the first field of a form is common requirement. Doing this in Smart GWT is as simple as setting <code>form.setAutoFocus(true)<\/code>.<\/p><p>This sample also has <code>setSelectOnFocus(true)<\/code> on the first field.<\/p>',zWf='<p>Smart GWT combines large dataset handling with adaptive use of client-side filtering.<\/p><p>Begin typing an Item name in the filter box above the "Item" column (for example type "Pens") . When the dataset becomes small enough, Smart GWT switches to client-side filtering automatically.<\/p><p>Delete part of the item name to see SmartClient automatically switch back to server-side filtering. The label underneath the grid flashes briefly every time Smart GWT needs to visit the server.<\/p>',JWf='<p>Smart GWT combines large dataset handling with adaptive use of client-side sort.<\/p><p>Click any header now and server-side sort will be used for this large dataset. Check "Limit to Dictionaries" to limit the dataset and sort again: when the dataset becomes small enough, Smart GWT switches to client-side sorting automatically.<\/p><p>The label underneath the grid flashes briefly every time Smart GWT needs to visit the server.<\/p>',uZf="<p>Smart GWT provides a unified Offline browser storage API that your programs can use for any client-side persistence task. In this example, we store the ListGrid's viewState to browser-local storage. Try resizing or reordering some columns in the grid, click \"Persist State\", then press F5 to reload, or close and re-open the browser; your changes have been remembered. Try adding a formula field to the grid and reload again. Persisting a user's preferences like this is a compelling addition to any application, and in this case we don't even need a server.<\/p><p>Offline support is provided in modern HTML5 browsers, and also in older versions of Internet Explorer (6 and greater); the underlying technologies used are very different, but the SmartClient API you use is the same regardless of browser. <\/p>",UWf='<p>Smart GWT provides special widgets for filtering date values, including recognised RelativeDate values that cause filtering relative to some other base-date.<\/p><p>The RelativeDateRangeItem allows selection of dates in three ways: you can select a preset DateRange, like "Today" or "Tomorrow", or a "ranged" date-string, such as "N days from now" and enter a quantity to associate with it, or you can directly enter a date-string in a recognized format. You can also select a date from the DateChooser by click the icon to the right of the widget. <p><p>The first example below demonstrates using a DateRangeItem in a separate DynamicForm to filter a ListGrid. Select start and end values for the range using one of the methods described above and click the "Search" button to see the data filtered according to the values in the "Nationhood" field.<\/p><p>The second example below demonstrates filtering grid data using a MiniDateRangeItem to filter data when a ListGrid is showing it\'s FilterEditor. In this example, click the Date icon in the header for the Nationhood field to open a popup DateRangeItemDialog. In the dialog, select start and end values for the range, as described above, and click Ok to close the Window. Then click the Filter button in the top right of the grid to see the data filtered. You can hover the mouse over the Nationhood field-header to see the full date-range string.<\/p>',zNf='<p>TextItems support a masked entry to restrict and format entry.<\/p><p>Overview of available mask characters <P> <table class="normal"> <tr><th>Character<\/th><th>Description<\/th><\/tr> <tr><td>0<\/td><td>Digit (0 through 9) or plus [+] or minus [-] signs<\/td><\/tr> <tr><td>9<\/td><td>Digit or space<\/td><\/tr> <tr><td>#<\/td><td>Digit<\/td><\/tr> <tr><td>L<\/td><td>Letter (A through Z)<\/td><\/tr> <tr><td>?<\/td><td>Letter (A through Z) or space<\/td><\/tr> <tr><td>A<\/td><td>Letter or digit<\/td><\/tr> <tr><td>a<\/td><td>Letter or digit<\/td><\/tr> <tr><td>C<\/td><td>Any character or space<\/td><\/tr> <tr><td>&nbsp;<\/td><\/tr> <tr><td>&lt;<\/td><td>Causes all characters that follow to be converted to lowercase<\/td><\/tr> <tr><td>&gt;<\/td><td>Causes all characters that follow to be converted to uppercase<\/td><\/tr> <\/table> <P> Any character not matching one of the above mask characters or that is escaped with a backslash (\\) is considered to be a literal. <P> Custom mask characters can be defined by standard regular expression character set or range. For example, a hexadecimal color code mask could be: <UL> <LI>Color: \\#>[0-9A-F][0-9A-F][0-9A-F][0-9A-F][0-9A-F][0-9A-F]<\/LI> <\/UL><\/p?',nLf='<p>The CustomPicker example demonstrates various custom picker icons that (YesNoMaybeItem) implemented as a "picker" that the user can pop up from a picker icon next to a form or grid value.<\/p>',yNf='<p>The CustomPicker example demonstrates various standard picker icons that provided with the library. You can combine as many pickers as you like as illustrated by the sample below.<\/p>',LHf="<p>The RestDataSource provides a simple protocol based on XML or JSON over HTTP.<\/p><p>This protocol can be implemented with any server technology (PHP, Ruby, ..) and includes all the features of Smart GWT's databinding layer (data paging, server validation errors, cache sync, etc).<\/p><p>In this example, each DataSource operation is directed to a different XML file containing a sample response for that operationType. The server returns the data-as-saved to allow the grid to update its cache.<\/p>",Xnf='<p>The calendar can automatically arrange events that share time so that each is always fully visible at its proper location. Drag one event onto or away from another to see the effect.<\/p>',Rof="<p>This calendar is bound to a dataSource. Drag events to alter their start times, and resize events to alter their durations.<\/p> <p>Click and drag in an empty cell to create new events, or click on an existing event to edit it. Notice how the red event can't be edited; This was specified within the event data itself.<\/p>",Uof="<p>This calendar is bound to an array of event data. Drag events to alter their start times, and resize events to alter their durations.<\/p><p>Click and drag in an empty cell to create new events, or click on an existing event to edit it. Notice how the red event can't be edited; This was specified within the event data itself.<\/p>",MZf='<p>This example demonstrates a DataSourceField that is based on a user created <code>SimpleType<\/code>. As illustrated in this sample, a user can create a reusable ZipCode SimpleType class with a regular expression based <code>com.smartgwt.client.widgets.form.validator.Validator<\/code> and then use this SimpleType in various DataSourceField definitions across their application for use with any DataBoundComponent like a ListGrid, TreeGrid, DynamicForm etc.<\/p><p>This is a powerful feature allows creation and reuse of domain specific "primitive" data types or types in the enterprises Common Data Model (CDM).<p>Enter a bad zip code (eg just "123") and press "Validate" to receive a validation error. Custom types can be declared based on built-in validators and re-used in multiple DataSources.<\/p>',xVf='<p>This example demonstrates hiliting in a data-driven fashion, where hilites contain no criteria, and instead the data itself is flagged by setting the <i>DataBoundComponent.hiliteProperty<\/i> attribute on each record. This method is useful when some complex server-based calculation is used to decide which records to hilite, and the client only needs to handle displaying them. <\/p> ',NVf='<p>This example demonstrates producing hilites in code. The hilites applied to the grid below match those suggested in the User Defined hilites example. Additionally, the Advanced Hilite in this example also demonstrates using <i>Canvas.imgHTML()<\/i> and the <i>htmlAfter<\/i> attribute of hilite-objects to append a warning icon to the end of each field value, as part of the hilite. <\/p><p>Hilite-objects also support an htmlBefore attribute - you can use these before and after properties to extend color-based hilites to format values, for instance, as bold or italic text using HTML tags. <\/p> ',kOf='<p>This example demonstrates two select items, both of which load data on the fly from a DataSource, where the "Category" drop-down controls the list of available items in the "Item" drop-down.<\/p><p>Try selecting a value in the "Category" drop-down list to change the set of options available in the "Item" drop-down.<\/p>',pZf='<p>This example illustrates DataSource driven widgets. The Grid and Form widgets themselves are completely driven by the DataSource definition and do not have any code specific to displaying labels or fields from either datasource.<\/p><p>Click to select a DataSource, click on records to edit them in the adjacent form, then click the "Save" button to save changes. This resuable component combines a databound form and grid into a reusable application pattern of side-by-side editing, that can be used with any DataSource.<\/p>',NPf='<p>This example illustrates embedding arbitrary widgets in ListGrid cells. Notice how reordering the column with widgets works as any other column. Smart GWT users widget pooling to maximize efficiency however for better performance consider using one or more fields of type ListGridFieldType.ICON<\/p>.',ZRf='<p>This example illustrates how a ListGrid configuration can be saved as a user preference and later restored. Notice how the position of custom fields created by the Formula Builder and Summary Builder are also captured and restored.<\/p><p>The ListGrid configuration comprises of field state, sort state and selection state and these can be obtained separately by calling ListGrid.getFieldState(), ListGrid.getSortState() and ListGrid.getSelectionState() respectively. ListGrid.getViewState() can be called to return all three states.<\/p><p>The configuration state is a String which can be sent to the server to store and later retrieve the ListGrid state.<\/p>',J2f='<p>This example illustrates how a TreeGrid configuration can be saved as a user preference and later restored. Notice how the expansion of the nodes and the position of custom fields created by the Formula Builder and Summary Builder are also captured and restored.<\/p><p>The TreeGrid configuration comprises of field state, sort state and selection state and these can be obtained separately by calling TreeGrid.getFieldState(), TreeGrid.getSortState() and TreeGrid.getSelectionState() respectively. TreeGrid.getViewState() can be called to return all three states.<\/p><p>The configuration state is a String which can be sent to the server to store and later retrieve the TreeGrid state.<\/p>',tof='<p>This example illustrates how the Calendar event dialog and editor can be completely customized.The <b>Sharing<\/b> radio options on the event dialog is custom, as well as the <b>Repeats<\/b> and <b>Reminder<\/b> Select Items on the eventdetails edit dialog.<\/p>',p_f='<p>This example illustrates the ability to drag-reorder sections. Simply drag the headers of the sections to reorder.<\/p>',aNf='<p>This example shows a reusable CanvasItem that edits nested data structures.<\/p><p>Here, a record representing an Order contains multiple OrderItem records &mdash; in the Record for an Order the "items" field value is set to an Array of Records representing OrderItems.<\/p><p>The CanvasItem embeds an editable ListGrid to provide an editing interaction for the OrderItems right in the midst of the form. It can be used with any DataSource that has nested records.<\/p>',MUf="<p>This grid displays a limited number of fields from the supplyItem dataSource.<\/p><p>You can expand a row by clicking the special expansionField to see a DetailViewer embedded in the expanded portion of the record which displays the rest of the data from the dataSource that isn't already visible in the grid. <\/p>",KUf="<p>This grid displays some fields from the Countries dataSource. You can expand a row by clicking the special expansionField to see the details of the selected country's background in the expanded section.<\/p>",rSf='<p>This grid hilites "Population" values greater than 1 billion or less than 50 million using a full set of compound styles (with customized background colors).<\/p><p>Mouse over or click-drag rows to see how these styles apply to different row states.<\/p>',fXf='<p>This grid is displayed pre-sorted on two fields: first by Category ascending and then by Item Name descending. As well as the field\'s title, the header of each field included in the sort configuration displays a sort-arrow indicating the direction of sort on that field and, when multiple fields are sorted, a small numeral indicating this field\'s position in the list of fields being sorted. You can hold down SHIFT and click an already sorted column-header to reverse it\'s direction, or an unsorted column- header to add that field to the list of fields being sorted. Clicking a column header without holding down SHIFT clears the current sort configuration and initializes a new sort on the selected field.<\/p><p>Click the "Multilevel Sort" button to show a MultiSortDialog. Select a set of sort properties and directions and click "Apply" to see the grid resorted by those properties.<\/p>',jSf='<p>This is an example of a ListGrid with a top level header. This is accomplished easily by adding the ListGrid to a non-collapsible SectionStackSection.<\/p>',DUf='<p>This is an example of editing with all editors active. This is done by simply calling : <pre>listGrid.setAlwaysShowEditors(true)<\/b><\/pre>',o1f='<p>Tiled views can be filtered and sorted just like ListGrids. Use the "Search" form to eliminate some tiles and watch remaining tiles animate to new positions.<\/p><p>Use the "Sort" form to change the sort direction.<\/p>',Z_f='<p>Titles can be changed on the fly. Type in your name to see the "Preferences" tab change its title to include your name.<\/p><p>Note that the tab automatically sizes to accomodate the longer title - automatic sizing also happens at initialization.<\/p>',yXf='<p>To center components within layouts, set layout.align to center along the length axis (vertical axis for a VLayout, horizontal axis for an HLayout).<\/p><p>To center along the breadth axis (horizontal axis for an VLayout, vertical axis for an HLayout), set member.layoutAlign on each member that should be centered, or set layout.defaultLayoutAlign to center all members.<\/p><p>Combine both settings to center along both axes.<\/p><p>You can also use LayoutSpacers to center components. This is particularly useful if you have a layout where you want to center something in the remaining space after other components have taken the space they require.<\/p>',s2f='<p>Tree selection can be automatically propagated up and down the tree. Select a parent or child node to see how other nodes are affected.<\/p>',E2f='<p>Trees can show multiple columns of data for each node. Each column has the styling, formatting, and data type awareness features of columns in a normal grid.<\/p><p>Try drag reordering columns, or sorting by the Salary field.<\/p>',H3f='<p>Try dragging employees under new managers. Note that a position indicator line appears during drag, allowing employees to be placed in a particular order.<\/p>',K3f='<p>Try dragging employees under new managers. Note that closed folders automatically open if you hover over them momentarily.<\/p>',ZWf='<p>Type "island" above the Country column, then press Enter or click the filter button (top-right corner of the grid) to show only countries with "island" in their name.<\/p><p>Select "North America" above the Continent column to filter countries by that continent. Filtering is disabled on the "Flag" and "Capital" columns.<\/p>',cXf='<p>Type "island" above the Country column, then press Enter or click the filter button (top-right corner of the grid) to show only countries with "island" in their name.<\/p><p>Select "North America" above the Continent column to filter countries by that continent.<p>',qQf='<p>Use the FilterBuilder to construct custom queries that combine multiple criteria across any field in your DataSource.<\/p><p>Note that the operator select list only shows operators suitable for the field selected, and the comparison field changes to suit the type of the selected field (for example, select field "independence" and note that the comparison field changes to a date).<\/p><p>Add clauses to your query with the "+" icon. Click "Filter" to see the result in the ListGrid.<\/p>',FQf='<p>Use the FilterBuilder to construct queries of arbitrary complexity. The FilterBuilder, and the underlying AdvancedCriteria system, support building queries with subclauses nested to any depth.<\/p><p>Add clauses to your query with the "+" icon; add nested subclauses with the "+()" button. Click "Filter" to see the result in the ListGrid.<\/p>',VUf='<p>Use the form to create a new stock item. Create an item in the currently shown category to see it appear in the filtered listing automatically.<\/p>',OWf="<p>When a FilterBuilder must work with a very large number of fields, you can set FilterBuilder.fieldDataSource to a DataSource containing records that represent the fields to display in the FieldPickers in each clause. The FilterBuilder below is created without a normal DataSource, but specifies a fieldDataSource and the FieldPicker items in each clause are populated dynamically with it's records. In this mode, the FieldPickers are represented by ComboBoxItems, rather than SelectItems, and have default settings that provide type-ahead auto-completion.<p><p>Note also that, when fieldDataSource is specified and the operator for a clause is of a type that uses a field-lookup, the valueField is also populated dynamically by the fieldDataSource.<\/p>",Sof="<p>When eventAutoArrange is true, you can have the Calendar overlap concurrent events slightly. The z-order is from left to right and the overlap-size is a percentage of event-width <\/p>. <p>If two events start at exactly the same time, the default behaviour is to reject the overlap to avoid the first event's close button from being hidden by the second event. You can see this by dropping one event onto the start-time of another below.<\/p>",Ykf="<span class='exampleDropTitle'>Ajax&nbsp;&nbsp;<\/span> <b>A<\/b>synchronous <b>J<\/b>avaScript <b>A<\/b>nd <b>X<\/b>ML (AJAX) is a Web development technique for creating interactive <b>web applications<\/b>. The intent is to make web pages feel more responsive by exchanging small amounts of data with the server behind the scenes, so that the entire Web page does not have to be reloaded each time the user makes a change. This is meant to increase the Web page's <b>interactivity<\/b>, <b>speed<\/b>, and <b>usability<\/b>. (Source: <a href='http://www.wikipedia.org' title='Wikipedia' target='_blank'>Wikipedia<\/a>)",Lpf="<span style='color:#0000FF;'>Blue<\/span>",Kpf="<span style='color:#00FF00;'>Green<\/span>",Jpf="<span style='color:#FF0000;'>Red<\/span>",U1f="<span style='  in its efforts to build a democratic political system and market economy to replace the strict social, political, and economic controls of the Communist period. While some progress has been made on the economic front, recent years have seen a recentralization of power under Vladimir PUTIN and the erosion of nascent democratic institutions. A determined guerrilla conflict still plagues Russia in Chechnya and threatens to destabilize the North Caucasus region.',qpf='France',l3f='Francine Dugas',qxf='Free Space',Yef='FreeSpaceSample',Zlg='FreeSpaceSample$1',Ylg='FreeSpaceSample$Factory',eWe='Freeze',fWe='Freeze on left',gWe='Freeze on right',OIf='Fresh Water',PIf='Freshwater Stingray',EPe='Fri',xPe='Friday',KUe='From',kUe='From must be before To',Ekf='Front',Dyf='Frozen Columns',Zef='FrozenColumnsSample',wvg='FrozenColumnsSample$Factory',E1f='Full Image',pOf='Full Name',$Xe='Full justify selection',Srf='G8',XTf='G8 Member?',QRf='GDP',$Sf='GDP ($B)',bsf='GDP ($M)',$Tf='GDP (per capita)',u$e='GETPARAMS',npf='GM',eTf='GM;Germany;Berlin',R0e='GREATER_OR_EQUAL',K1e='GREATER_OR_EQUAL_FIELD',N0e='GREATER_THAN',G1e='GREATER_THAN_FIELD',E0e='GRID',NRe='GWT  Button',sXf='GWT Button',Luf='GWT Integration',tXf='GWT Logo',qXf='GWT Tabs',usf='Gender',h2f='Gene Porter',opf='Germany',NIf='Giant Pacific Octopus',bpf='Giraffe',Zsf='Glue Pelikan Roll-fix Non Permanent #960',Usf='Glue Pelikan Roll-fix Permanent #950',_sf='Glue Pelikan Roll-fix Refill Non Permanent #965',Xsf='Glue Pelikan Roll-fix Refill Permanent #955',xYf='Go to category',wYf='Go to department',cpf='Goat',xlf='Google',Rrf='Government',XRf='Government & Politics',P3f='Grab the window by its title bar to move it around. Resize it by the right or bottom edge.',Whf='Graphite',lMf="Great Britain, the dominant industrial and maritime power of the 19th century, played a leading role in developing parliamentary democracy and in advancing literature and science. At its zenith, the British Empire stretched over one-fourth of the perlink URL:',uOf='I accept the agreement',BLf='I accept the terms of use.',pXf="I am a GWT 'HTML' Widget. Click one of the tabs to see more content.",rXf='I am a GWT Image Widget',fPf="I'll be in town Saturday.  Give me a call on my cell and we'll check out the new Thai restaurant on Polk Street. Jamie said it's great but too spicy for him, shouldn't be a problem for you :)",mPf="I'll be in town Saturday.  Give me a call on my cell and we'll get a bite to eat.",Phf="I'm feeling lucky",l7e='IButton',y0e='ICON',$0e='ICONTAINS',_Se='ID',oTf='ID;Indonesia;Jakarta',c1e='IENDS_WITH',J0e='IEQUALS',idg='IFramesSample',kdg='IFramesSample$1',ldg='IFramesSample$2',mdg='IFramesSample$3',ndg='IFramesSample$4',jdg='IFramesSample$Factory',L_e='IMAGE',P_e='IMAGEFILE',bcf='IMenuButton',sOe='IN',dTf='IN;India;New Delhi',K3e='INHERIT',B3e='INLINE',k1e='INOT_CONTAINS',o1e='INOT_ENDS_WITH',L0e='INOT_EQUAL',m1e='INOT_STARTS_WITH',t_e='INTEGER',F_e='INTENUM',y1e='IN_SET',t9e='IPickTreeItem',s1e='IREGEXP',c$e='ISCSERVER',a1e='ISTARTS_WITH',u1e='IS_NULL',rpf='IT',hTf='IT;Italy;Rome',Nag='IconClickEvent',DCf='Icons',WRf='Identification',KYe='Identifiers must start with a letter, underscore or $ character, and may contain only letters, numbers, underscores or $ characters.',Cwg='IllegalArgumentException',Dwg='IllegalStateException',tzf='Image',O6f='Image$State',P6f='Image$State$1',Q6f='Image$UnclippedState',Z8f='ImageStyle',$8f='ImageStyle;',u6e='Img',o7e='ImgButton',qcg='ImgProperties',odg='ImgSample',pdg='ImgSample$Factory',zcf='ImgSplitbar',aMf="In 1603, a Tokugawa shogunate (military dictatorship) ushered in a long period of isolation from foreign influence in order to secure its power. For 250 years this policy enabled Japan to enjoy stability and a flowering of its indigenous culture. Following the Treaty of Kanagawa with the US in 1854, Japan opened its ports and began to intensively modernize and industrialize. During the late 19th and early 20th centuries, Japan became a regional power that was able to defeat the forces of both China and Russia. It occupied Korea, Formosa (Taiwan), and southern Sakhalin Island. In 1931-32 Japan occupied Manchuria, and in 1937 it launched a full-scale invasion of China. Japan attacked US forces in 1941 - triggering America's entry into World War II - and soon occupied much of East and Southeast Asia. After its defeat in World War II, Japan recovered to become an economic power and a staunch ally of the US. While the emperor retains his throne as a symbol of national unity, actual power rests in networks of powerful politicians, bureaucrats, and business executives. The economy experienced a major slowdown starting in the 1990s following three decades of unprecedented growth, but Japan still remains a major economic power, both in Asia and globally. In 2005, Japan began a two-year term as a non-permanent member of the UN Security Council.",Ssf='In Stock',_mf='In the 16th century, Spanish explorers in what is now Florida encountered a large formidable animal which they called "el largo" meaning "the lizard". The name "el largo" gradually became pronounced "alligator".',k0f="In the beginning, Ettore Bugatti told the world that his cars would better those built by the likes of Rolls-Royce and Mercedes Benz. This Royale was his ultimate model and, as the name suggests, it was really only royalty of the day who could afford one. Just six were built, complete with 12.7 litre engines, but only four were sold during the 1930s. Bugatti kept the other two hidden on his French estate during World War II, safe from German invaders who would have had them requisitioned. In 1951, an American called Briggs Cunningham bought the two hidden Royales, exchanging them for cash and a couple of refrigerators. Both were displayed in Cunningham's California museum for 30 years. One was auctioned to an anonymous Japanese buyer at Christies in London in 1987 setting a new record for most valuable car, which hasn't been topped since.",YXe='Indent selection',tQf='Independence',p4f='Index: ',xwg='IndexOutOfBoundsException',mpf='India',WIf='Indian Rock Python',SMf='Indonesia',csf='Info',cLf='Informal',XMf='Initial Values:<br>',Uzf='Inline Data',sSe='Inner',Smf='Insects and Larvae',j8e='Inspection',JYf='Instructions',yzf='Integer',bag='Integer;',Uag='IntegerItem',_ag='IntegerRangeValidator',Lwf='Interaction',Pmf='Interesting Facts',qVe='Invalid $builderType: $errorText',pVe='Invalid blank $builderType',DUe='Invalid date',uLf='Invalid email address',VUe='Invalid username or password',AUe='Invalid value',G3f='Inventory Ck',g0f="It's the most expensive production car in the world, but many would argue that the Veyron is still a bargain, being the most powerful and the fastest. Not only does the Bugatti have a top speed of 253mph but it would out accelerate an F1 car to 100mph. There are just too many astonishing facts and figures to take in; the 16-cylinder engine alone with its four turbochargers and 10 radiators is a marvel. But perhaps the most crucial figure is its mind-bending 1001bhp maximum power. Although the Veyron is unspeakably expensive, it cost the VW Group (which owns Bugatti) more to design and build than it's ever likely to return in profit. It's simply a magnificent engineering achievement.",I0f="It's the quintessential Italian supercar - front-engined, rear drive and stunningly beautiful. GTO stands for Gran Turismo Omologata (meaning homologation) because this 250 was built for GT racing, and manufacturers had to enter a race-spec version of a real production car. So the 250 GTO was designed to be as competitive on the track as it was accomplished on the road, and was also the last in a long line of Ferraris to use the classic 3.0 litre V12. Only 33 250 GTOs were ever built, even though the minimum for production car status was 100. The regulations were, as they so often have been, bent by the weight of Maranello. But it meant the 250 GTO is now not only a stunning, but also a rare performance car, which has only made it more valuable. Now most commentators reckon that, should one be sold again, the 250 GTO would be the most valuable Ferrari in the world.",spf='Italy',sMf="Italy became a nation-state in 1861 when the regional states of the peninsula, along with Sardinia and Sicily, were united under King Victor EMMANUEL II. An era of parliamentary government came to a close in the early 1920s when Benito MUSSOLINI established a Fascist dictatorship. His disastrous alliance with Nazi Germany led to Italy's defeat in World War II. A democratic republic replaced the monarchy in 1946 and economic revival followed. Italy was a charter member of NATO and the European Economic Community (EEC). It has been at the forefront of European economic and political unification, joining the Economic and Monetary Union in 1999. Persistent problems include illegal immigration, organized crime, corruption, high unemployment, sluggish economic growth, and the low incomes and technical standards of southern Italy compared with the prosperous north.",Upf='Item',uqf='Item (Select)',MYf='Item Details',rqf='Item Name',MQf='Item Name 2',YQf='Item Name 3',KQf='Item No.',Iag='ItemChangedEvent',Ibg='ItemClickEvent',tgf='ItemData',Mrg='ItemDetailTabPane',Nrg='ItemDetailTabPane$1',Org='ItemDetailTabPane$2',aZf='ItemDetailTabPane.java',Oag='ItemHoverEvent',Prg='ItemListGrid',Qrg='ItemListGrid$1',Rrg='ItemListGrid$2',cZf='ItemListGrid.java',ugf='ItemRecord',mfg='ItemRecord;',vgf='ItemSupplyLocalDS',wgf='ItemSupplyXmlDS',gZf='ItemSupplyXmlDS.java',GOe='J',kpf='JA',cTf='JA;Japan;Tokyo',F4e='JSO::convertMapToJavascriptObject : Map contains null key - dropping this entry.',G4e='JSO::convertMapToJavascriptObject : skipping __ref in map',g$e='JSON',Wzf='JSON DataSource',$5f='JSONArray',_5f='JSONBoolean',eag='JSONEncoder',a6f='JSONException',b6f='JSONNull',c6f='JSONNumber',d6f='JSONObject',g6f='JSONString',Z5f='JSONValue',g3f='Jacques Desautels',o3f='Jacques Leblanc',TMf='Jakarta',dNf='James Edwards',$Oe='Jan',OOe='January',YLf='Japan',X4f='JavaScriptException',Y4f='JavaScriptObject$',$9f='JavaScriptObject$;',osf='Job',r7f='JsObject',t7f='JsObject$SGWT_WARN',xgf='JsonSimpleSample',ufg='JsonSimpleSample$Factory',ygf='JsonXPathSample',vfg='JsonXPathSample$Factory',dPe='Jul',UOe='July',cPe='Jun',TOe='June',OMf='KS',nTf='KS;South Korea;Seoul',A3f='Kai Kong',i3f='Kay Monroe',sVe='Key',u7f='KeyIdentifier',awg='KeyIdentifier;',JCf='KeyPress Filters',YOf='KeyPress filters help prevent the user from entering invalid characters. Additionally, character casing can be forced to either upper or lowercase.',Pag='KeyPressEvent',Yig='KeyPressFiltersSample',Zig='KeyPressFiltersSample$Factory',RMf="Korea was an independent kingdom for much of the past millennium. Following its victory in the Russo-Japanese War in 1905, Japan occupied Korea; five years later it formally annexed the entire peninsula. After World War II, a Republic of Korea (ROK) was set up in the southern half of the Korean Peninsula while a Communist-style government was installed in the north (the DPRK). During the Korean War (1950-53), US troops and UN forces fought alongside soldiers from the ROK to defend South Korea from DPRK attacks supported by China and the Soviet Union. An armistice was signed in 1953, splitting the peninsula along a demilitarized zone at about the 38th parallel. Thereafter, South Korea achieved rapid economic growth with per capita income rising to roughly 14 times the level of North Korea. In 1993, KIM Yo'ng-sam became South Korea's first civilian president following 32 years of military rule. South Korea today is a fully functioning modern democracy. In June 2000, a historic first North-South summit took place between the South's President KIM Tae-chung and the North's leader KIM Jong Il.",RXf='L',PYe='LEFT',T0e='LESS_OR_EQUAL',M1e='LESS_OR_EQUAL_FIELD',P0e='LESS_THAN',I1e='LESS_THAN_FIELD',J_e='LINK',iZe='LOWER',SPe='LTR';

ersion is just a bit more flash. It's got a 6.5 litre V12 that's silky smooth in its power delivery and cossets all occupants from the moment they climb through its huge doors. A high price, but seen as worth every penny by some - Rolls-Royce sales are steadily creeping up.",Xmf='The African Elephant is the largest of all land animals and also has the biggest brain of any land animal. Both males and females have ivory tusks. Elephants are also wonderful swimmers. Man is the only real enemy of the elephant. Man threatens the elephant by killing it for its tusks and by destroying its habitat.',VMf="The Dutch began to colonize Indonesia in the early 17th century; the islands were occupied by Japan from 1942 to 1945. Indonesia declared its independence after Japan's surrender, but it required four years of intermittent negotiations, recurring hostilities, and UN mediation before the Netherlands agreed to relinquish its colony. Indonesia is the world's largest archipelagic state and home to the world's largest Muslim population. Current issues include: alleviating poverty, preventing terrorism, consolidating democracy after four decades of authoritarianism, implementing financial sector reforms, stemming corruption, and holding the military and police accountable for human rights violations. Indonesia was the nation worst hit by the December 2004 tsunami, which particularly affected Aceh province causing over 100,000 deaths and over $4 billion in damage. An additional earthquake in March 2005 created heavy destruction on the island of Nias. Reconstruction in these areas may take up to a decade. In 2005, Indonesia reached a historic peace agreement with armed separatists in Aceh, but it continues to face a low intensity separatist guerilla movement in Papua.",slf='The HTMLFlow component displays a chunk of standard HTML in a free-form, flowable region.',tlf='The HTMLPane component displays a chunk or page of standard HTML in a sizeable, scrollable pane.',Dlf='The Img component displays images in the standard web formats (png, gif, jpg) and other image formats supported by the web browser.',dMf='The Indus Valley civilization, one of the oldest in the world, dates back at least 5,000 years. Aryan tribes from the northwest infiltrated onto Indian lands about 1500 B.C.; their merger with the earlier Dravidian inhabitants created the classical Indian culture. Arab incursions starting in the 8th century and Turkish in the 12th were followed by those of European traders, beginning in the late 15th century. By the 19th century, Britain had assumed political control of virtually all Indian lands. Indian armed forces in the British army played a vital role in both World Wars. Nonviolent resistance to British colonialism led by Mohandas GANDHI and Jawaharlal NEHRU brought independence in 1947. The subcontinent was divided into the secular state of India and the smaller Muslim state of Pakistan. A third war between the two countries in 1971 resulted in East Pakistan becoming the separate nation of Bangladesh. Despite impressive gains in economic investment and output, India faces pressing problems such as the ongoing dispute with Pakistan over Kashmir, massive overpopulation, environmental degradation, extensive poverty, and ethnic and religious strife.',Ilf='The Label component adds alignment, text wrapping, and icon support for small chunks of standard HTML.',Spf='The SelectItem displays multiple fields in a ListGrid. You can scroll to dynamically load more records. This pattern works with any DataSource.',Vof='The calendar can focus in on workday hours, giving a clearer view of events that occur durring the work day. The boundaries of the workday itself can also be customized.',aVe='The following errors were found',oVe='The following fields are available for use in this',blf='The future has a way of arriving unannounced.',rVe='The generated function is invalid - Check your $builderType and retry.',Qsf='The maximum allowed precision is 2',e1f="The most powerful version of the Swedish supercar and - before the arrival of the Veyron and SSC Aero - the CCR was the fastest production car in the world. It topped out at 240mph at the Nardo proving grounds - the first car to break the McLaren F1's previous record, which had stood for 10 years. Incredibly, Koenigsegg has managed to coax over 800bhp from a Ford V8 for this CCR, one of the reasons why it's the company's ultimate and most expensive model. It was even considered worthy of the 'ghost' fighter badge, worn only by the planes of Swedish Jet Fighter Squadron No.1.",IMf='The site of advanced Amerindian civilizations, Mexico came under Spanish rule for three centuries before achieving independence early in the 19th century. A devaluation of the peso in late 1994 threw Mexico into economic turmoil, triggering the worst recession in over half a century. The nation continues to make an impressive recovery. Ongoing economic and social concerns include low real wages, underemployment for a large segment of the population, inequitable income distribution, and few advancement opportunities for the largely Amerindian population in the impoverished southern states. Elections held in July 2000 marked the first time since the 1910 Mexican Revolution that the opposition defeated the party in government, the Institutional Revolutionary Party (PRI). Vicente FOX of the National Action Party (PAN) was sworn in on 1 December 2000 as the first chief executive elected in free and fair elections.',o0f="The ultimate version of Pagani's mid-engined supercar, and also the most costly. The 'F' stands for Fangio, the Formula One legend who had a hand in the original Zonda's development. Powered by a mid-mounted Mercedes V12 engine, the Zonda F is lighter and tauter than previous models, with a top speed of 199mph. Buy one and you'll also get a pair of driving shoes hand made by the Pope's cobbler.",DWe='Then by',rTf='This ListGrid binds to a DataSource that loads data from a remo
